import { Friend, LiItem, Status, Avatar } from "./friends.styled";

export const Friends = ({friends}) => {
    return (
        <Friend>
            {friends.map(friend => (
                <LiItem key={friend.id}>
                    <Status isOnline={friend.isOnline}></Status>
                    <Avatar src={friend.avatar} alt={friend.name} width="60" />
                    {friend.name}
                </LiItem>
            ))}
            
        </Friend>
    );
}
